import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-f05d3ed8.js";const o={},c=t("<p>《三命通会》卷 九·六辛日乙未时断</p><p>六辛日生时乙未，火木相成金不畏；</p><p>月通金气与春荣，财旺生官身自贵。</p><p>辛日乙未时，天财入库。</p><p>辛以乙为财，未上入库；己为倒食，丁为正鬼；未上有暗丁，己被明乙制伏，不能为害。</p><p>若通巳酉丑月者，贵，通火，行西运；通金，行南运，俱贵。</p><p>辛丑日乙未时。</p><p>刑。</p><p>亥卯未寅月，财旺生官不贵则富。</p><p>辰戌丑子，俱吉。</p><p>辛卯日乙未时，亥卯未月，财盛生官，吉。</p><p>辛巳日乙未时，月通金火，贵。</p><p>运通，亦贵。</p><p>辛未日乙未时，寅卯未年月，财旺生官，名高禄重。</p><p>通火气，行西运；通金气，行南，俱吉。</p><p>辛酉日乙未时，月通火气，行东运，贵。</p><p>辰戌丑未，最吉。</p><p>亥卯，贵显不久。</p><p>秋生，身太旺，财官无气，凶夭。</p><p>辛亥日乙未时，亥卯未月，财星格。</p><p>吉。</p><p>秋冬，孤独。</p><p>辰、丑，近侍三品。</p><p>未时辛日库门开，卓立家成自发财；金木运中身旺吉，几经险遇福重来。</p><p>辛日时逢乙未，库中透出偏财。</p><p>运行木金忌身衰，丑戌之运通泰。</p><p>经历初年发福，鸳帏抵敌无灾。</p><p>荣华富贵命中排，无破为官清泰。</p>",28),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","258卷 九·六辛日乙未时断.html.vue"]]);export{f as default};
